import { Component } from 'react'
import { connect } from 'react-redux'
import { setButtonNumber } from '../store/hooks'
import { Button } from 'react-bootstrap'

interface Props {
    page: any
    setButtonNumber: any
}

class Try extends Component<Props>{

    page = this.props.page
    setButtonNumber = this.props.setButtonNumber

    constructor(props: any) {
        super(props)

        console.log(this.props)
    }

    render = () => {

        const { button_number }: any = this.page

        return (
            <div className="App">
                <h1>Number : {button_number}</h1>
                <Button onClick={this.setButtonNumber}>Add</Button>
            </div>
        )
    }
}

const mapStateToProps = (state: any) => ({
    page: state.page
})

const mapDispatchToProps = () => ({
    setButtonNumber
})

export default connect(mapStateToProps, mapDispatchToProps)(Try)
